import { Parallax, Background } from 'react-parallax';
import { fondo } from '/2.png';
const Kisar = () => (
  <Parallax blur={{ min: -15, max: 15 }} bgImage={require('../public/2.png')} bgImageAlt="the dog" strength={-200}>
    Blur transition from min to max
    <div style={{ height: '200px' }} />
  </Parallax>
);
export default Kisar;
